const inputs = $input.all();

function parseXml(xmlString) {
  const entries = xmlString.match(/<entry>[\s\S]*?<\/entry>/g) || [];

  return entries.slice(0, 5).map(entry => {
    const titleMatch = entry.match(/<title>(.*?)<\/title>/s);
    const summaryMatch = entry.match(/<summary>(.*?)<\/summary>/s);
    const publishedMatch = entry.match(/<published>(.*?)<\/published>/);
    const idMatch = entry.match(/<id>(.*?)<\/id>/);

    return {
      title: titleMatch ? titleMatch[1].trim().replace(/\s+/g, ' ') : 'Unknown',
      summary: summaryMatch
        ? summaryMatch[1].trim().replace(/\s+/g, ' ').substring(0, 200) + '...'
        : 'No summary',
      published: publishedMatch ? publishedMatch[1].split('T')[0] : 'Unknown',
      pdf_url: idMatch ? idMatch[1] : 'Unknown'
    };
  });
}

return inputs.map(i => {
  const xmlString = i.json.data || '';  // your HTTP node stores XML in "data"
  const papers = parseXml(xmlString);

  return {
    json: {
      company_name: i.json.company_name,          // ‚úÖ correct company per item
      research_papers: JSON.stringify(papers),
      papers_count: papers.length
    }
  };
});

// Get the companies - it's stored as a STRING, so parse it
const companiesString = $input.first().json.companies;

// Parse the JSON string into an actual array
const companies = JSON.parse(companiesString);

// Now map over the array
return companies.map(company => ({
  json: {
    company_name: company.company_name,
    github_org: company.github_org
  }
}));

const companyName = $json.company_name;
const githubOrg = $json.github_org;

return {
  json: {
    company_name: companyName,
    github_org: githubOrg,
    repo_name: $json.name,
    full_name: $json.full_name,
