    watchers: $json.watchers_count || 0,
    open_issues: $json.open_issues_count || 0,
    created_at: $json.created_at,
    updated_at: $json.updated_at
  }
};

const input = $input.first().json;

// Skip if still waiting
if (!input.html_dashboard) {
  return [{ json: { status: 'skipped' } }];
}

const html = input.html_dashboard;

return [{
  json: {},
  binary: {
    data: {
      data: Buffer.from(html, 'utf8').toString('base64'),
      mimeType: 'text/html',
      fileName: 'tech_stack_dashboard.html',
      fileExtension: 'html'
    }
  }
}];

// input 0: the original company item (from Prepare Variables)
// input 1: the repos list output
const company = $input.first().json; // from Prepare Variables (company item)
const repos = $input.all().map(i => i.json); // repo items

return repos.map(r => ({
  json: {
    ...r,
    company_name: company.company_name,
    github_org: company.github_org,
    analysis_id: company.analysis_id
  }
}));

const staticData = $getWorkflowStaticData('global');
if (!staticData.allItems) staticData.allItems = [];

$input.all().forEach(item => {
  const d = {...item.json};
  if (d.company_name) d.company_name = d.company_name.trim();
  staticData.allItems.push(d);
});

return $input.all();

const staticData = $getWorkflowStaticData('global');
if (!staticData.allItems) staticData.allItems = [];
if (!staticData.papers) staticData.papers = {};
if (!staticData.runCount) staticData.runCount = 0;

staticData.runCount += 1;

// Store whatever comes in
$input.all().forEach(item => {
  const d = item.json;
  const name = d.company_name ? d.company_name.trim() : '';
  if (!name) return;

  if (d.research_papers) {
    try {
      const papers = typeof d.research_papers === 'string' ? 
        JSON.parse(d.research_papers) : d.research_papers;
      staticData.papers[name] = papers;
    } catch(e) {}
  } else {
    staticData.allItems.push(d);
  }
});

// Only generate HTML when BOTH inputs have arrived (runCount = 2)
if (staticData.runCount < 2) {
  staticData.runCount = staticData.runCount;
  return [{ json: { status: 'waiting' } }];
}

// Reset for next run
staticData.runCount = 0;
const storedItems = staticData.allItems;
const papersByCompany = staticData.papers;
staticData.allItems = [];
staticData.papers = {};

const companiesMap = {};

storedItems.forEach(d => {
  const name = d.company_name ? d.company_name.trim() : '';
  if (!name) return;
  if (!companiesMap[name]) {
    companiesMap[name] = { name, repos: 0, stars: 0, forks: 0, languages: {}, papers: [] };
  }
  if (d.repo_name) {
    companiesMap[name].repos += 1;
    companiesMap[name].stars += (d.stars || 0);
    companiesMap[name].forks += (d.forks || 0);
  }
  if (d.languages) {
    try {
      const langs = typeof d.languages === 'string' ? JSON.parse(d.languages) : d.languages;
      Object.keys(langs).forEach(l => {
        companiesMap[name].languages[l] = (companiesMap[name].languages[l] || 0) + langs[l];
      });
    } catch(e) {}
  }
});

// Apply papers
Object.keys(papersByCompany).forEach(name => {
  if (companiesMap[name]) {
    companiesMap[name].papers = papersByCompany[name];
  }
});

const companies = Object.values(companiesMap);

